import './MetroSelect.less';
import { Select } from 'antd';

const { Option } = Select;

const metroArr = [
  {
    name: 'Авиамоторная',
    color: '#ffc61a',
  },
  {
    name: 'Улица Академика Янгеля',
    color: '#a1a2a3',
  },
  {
    name: 'Университет',
    color: '#da2128',
  },
  {
    name: 'Рассказовка',
    color: '#ffc61a',
  },
  {
    name: 'Багратионовская',
    color: '#0078bf',
  },
];

const MetroSelect: React.FC = () => (
  <div>
    <Select
      mode="multiple"
      allowClear
    />
    metro select
  </div>
);

export default MetroSelect;
